	["companion"] = {
		["0104193915ukPYf"] = {
			["PE"] = {
				["v"] = 1,
			},
			["data"] = {
				["TX"] = "It was gifted to Charles by the Tol'vir priests from Uldum for his help during the researching of the Tol'vi history.",
				["read"] = false,
				["BK"] = 1,
				["NA"] = "Uldum'avara",
				["IC"] = "ABILITY_MOUNT_CAMEL_TAN",
				["v"] = 3,
			},
			["links"] = {
				["Ascrofte-ArgentDawn_88749"] = 1,
			},
		},
		["0210224141gPhlG"] = {
			["data"] = {
				["TX"] = "A young lad at the ripe age of fourteen! Born and raised within Stormwind's safe walls, he one day felt that his heart burned for adventure and sought his way down to the buzzing harbor where he, scrawny as he may be, managed to find swift employment upon a privateering frigate heading for Tanaris! \n\nHe soon learned that sailing was not only about feeling the fresh ocean wind through your hair and singing  chanteys with the other sailors. It was tough work upon body and mind. He found his skill and strenght suddenly patheticly lacking and soon became a target for mockery by the more experienced men and women upon the vessel. Especially the fact that he never spoke quickly became the subject for endless teasing, but he learned to endure it.\n\nHe had one good thing running for him however. He had been a quick study back in Stormwind with a wit quicker than most. He began to follow some of the sailors around, watching what they did and memorizing it. One particular man by the name of Beid soon became his involuntary teacher, and despite the rough sailor's hot temper earning him almost as many bruises as the labor itself did, he found that the rewarding knowledge far outweighted the physical torment. Another reason that he remained with this particular sailor, was that he didn't seem to mind that Dennis never spoke where as plenty of others often got annoyed with this little peculiarity. Soon he would barely leave Beid's side, sucking in all he could about the ways of handling a ship at sea. Beid had soon grown accustomed to his company, and the teachings came more willingly as time went by. Then came the day where they docked in Gadgetztan...",
				["read"] = true,
				["IC"] = "INV_Pet_Broom",
				["NA"] = "Dennis",
				["BK"] = 1,
				["TI"] = "Swabby",
				["v"] = 3,
			},
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "Appearance",
					["IC"] = "Spell_Nature_NatureTouchGrow",
					["TX"] = "The boy's quite scrawny for his age! Arms not much more than twigs of a young tree. He stands 5'5 feet tall, quite ordinary for his age. His by now scruffy hair carries a brown-blonde colour and upon his chin the very first meagre signs of what would one day become a beard of the same colour has begun to show.",
				},
				["3"] = {
					["AC"] = true,
					["TI"] = "Mute?",
					["IC"] = "INV_Misc_GroupLooking",
					["TX"] = "The lad doesn't speak much, if at all! Either mute or incredibly shy.",
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "Dirty and bruised",
					["IC"] = "Ability_Skyreach_Wind",
					["TX"] = "Getting used to the laboring life ain't easy for a city-boy!",
				},
				["4"] = {
					["AC"] = true,
					["TI"] = "Fleet-footed!",
					["IC"] = "Ability_Rogue_FleetFooted",
					["TX"] = "He's quite the quick little lad when he needs to be! A skill quite usefull upon a ship where most people gladly would slap a youngster around!",
				},
				["v"] = 1,
			},
			["links"] = {
				["Beid-ArgentDawn_Dennis"] = 1,
			},
		},
		["0602165043e2O5X"] = {
			["PE"] = {
