					["TI"] = "Puppy Eyes",
					["TX"] = "Stares with with large brown eyes that could melt anything.",
					["IC"] = "Sha_Ability_Rogue_BloodyEye_nightborne",
				},
				["v"] = 1,
			},
			["data"] = {
				["TX"] = "Buumba's most trusted companion ever since the monk rescued him from ogres in Alterac Mountains.... or was it the other way around?",
				["read"] = false,
				["NA"] = "Kappi",
