					["3"] = {
						["AC"] = true,
						["TI"] = "Multiple Personalities",
						["TX"] = "Jack suffers from a multiple personality disorder meaning he has more than one, overall having about four. One being relatively calm, upbeat and friendly, another is rather dark, violent, sadistic and cruel. The third is hyperactive and crazy and the final is low, sad and depressed.",
