						["TI"] = "Scars and missing ear",
						["TX"] = "Jack has a large scar over his face which starts just below his right eye, continues down his cheek and chin before passing over his neck and ending part way down his chest.\n\nIn the bottom and side of his right ear Jack has a two medium sized chunks of flesh missing, clearly having been torn and ripped out.",
