					["4"] = {
						["AC"] = true,
						["TI"] = "Weapons and gear",
						["TX"] = "Considering Jack prefers the art of using ranged weaponry he can usually be seen equiped with his bow and quiver or customised rifle.\n\nMost of his armour gear is either made from or is lined with a type of fur.",
