			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["IC"] = "Spell_Nature_Strength",
						["BK"] = 3,
						["TX"] = "Jack stands at average height if not slightly taller for a human with a relatively fit and athletic build. He appears average in terms of muscular build, not standing out too much and yet not seeming skinny and scrawny. His face is built with handsome features which go well with his light, well kept brown hair and calm, light blue eyes. One feature which seems slightly off about Jack's appearance is that his canine teeth are more like fangs, resembling more of a wolf type of tooth, being more pointed than usual. Down his face Jack has a rather large scar which begins beneath his right eye and travels down his cheek and chin before passing to his chest and ending part way down however this doesn't seem to bother him a lot. In his left ear Jack has two silver ring piercings part way up on the side of the ear which he can nearly always be seen wearing. \n\nIn terms of gear and armour he is almost always clad in armour either lined or made from fur or hide, especially during the winter to keep warm, his hood being the only item made completely from fur and hide. With weaponry Jack is always equiped with some form of ranged weapon whether that's his customised rifle or his bow and quiver. Along his belt has he two one-handed blades holstered, in case he needs to engage in close combat, as well as two flintlocks, knives, an assortment of pouches containing different items and usually some forms of explosive devices.",
					},
					["PS"] = {
						["IC"] = "Ability_Kaztik_DominateMind",
						["BK"] = 5,
						["TX"] = "In terms of personality Jack is very complicated due to him suffering from multiple personality disorder which gives him four different ones. The first one being when Jack is happy, upbeat, calm and friendly who enjoys joking around with friends. The second one is a more sinister personality causing Jack to become a bit more mentally unstable. He seems cruel and sadistic. The third personality means Jack becomes sad, depressed and low with the final one being hyperactive and insane.\n\nEven though he struggles to control these sometimes, he generally tries to be friendly but no matter which personality takes control he is always extremely protective of his family and close friends, often been known to take things too far to protect them. \n\nJack also pays attention to males meaning that he's homosexual.",
					},
