			},
			["time"] = 1496754762,
			["link"] = {
				["Pamelajill-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}Rebecca 'Becca' Corfilum{/h1}\n{h2:c}A Short Poem{/h2}\n{p:c}Before you stands a taller woman with eyes bright in wonder, it can be no other than wonderful Becca, from others picked asunder! \nShe smirks at you with dangerous lips, like parfait so sweet and colouring thick.\nHer skin, quite pale, is soft to the touch, but would she let you? One doubts it quite much.\nShe's slim, quite frail, yet stands quite strong; her legs as tempting as they are long.\nShe beckons you over, tattoos on her arm, threatening? Not quite, she won't do you much harm.\nBut do not be deceived,\nShe's a crafty one, indeed.\nIt's clear she would rather charm her foes, with dimpled cheeks, pierced ears, and nose.\nBrushing back her wavey brown hair, Oy vey! You're enthralled, you're locked in her stare.\nBefore you seats Becca, inquisitive look,\nShe puts down her pen, \nand closes her book.{/p}\n\n{h2:c}A Short History{/h2}\n{p:c}Gilnean-born Rebecca (Who more often goes by the name 'Becca'), spent most of her early years on a ship which docked from county to county. Ever since setting foot into the big city of Stormwind, she decided to make a life for herself, or try to, by doing what she loves.\n\nShe grew tired of saltwater and fish, and wanted to be part of something much bigger, and more exciting. With her trusty flute and songbook in hand, nothing can stand in her way.\n\nOr, so she thought.{/p}\n",
				},
