					["2"] = {
						["AC"] = true,
						["TI"] = "Injuries",
						["TX"] = "Small scars and cuts cover his entire body but some are much more pronounced than others.\n\nOn the back of his neck the word \"COWARD\" has been carved into his skin. Usually hidden by his shirt or armor.\n\nMorris is missing his right Index finger. The skin around the finger is horribly scarred, obviously removed by someone. ",
						["IC"] = "Ability_Butcher_GushingWounds",
