						["BK"] = 1,
						["TX"] = "Draeguul's friendly features represent that of a doting father, from the crows feet areoung his eyes to the wrinkles on his oak-like, large hands.\n\nHe often has a pleasant expression on his face and would never hesitate to laugh, his hair is like a silken mane which blend into his sideburns, which are well tended to, as well as his beard which stays trimmed.\n\nThe gentemen is always one for cracking a joke or two, but knows (even if it's just to ignore it) when to be serious. If he is every in a situation where others' lives are in jeaporady, he will be sure to help however he can and put himself as a seconday priority.\n\nWith that being said, the ferocity within him is bound to come out in almost uncharacteristic ways when he is pushed to his limits, and will not hesitate to use his experience in feral and minor balance druidism.",
