			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "A proud but rather modest gnomette, Pilli, is what you're inspecting. Usually with a smirk on her face she observes her surroundings and looks curious, yet not that interested in anything. She's part of a tactical force for a long time and is almost part of the wilds herself, lacking some of the basic manners, but still isn't actually a rude person either. She's in fit condition, light, strong and agile muscles with light but sturdy armour and a vicious sword. Small but deadly.\n\nShe can question alot of things, not that she doesn't agree with something but she likes details, sometimes perhaps a bit too much. There are also times when she doesn't interact at all, but is most likely listening.\n\nEquipped with an armour with multiple functions, one being her most commonly used tool, Springhook. As simple as it sounds it does exactly what it describes and fires a hook with a string attached to it. Her combat style is controlling and pinning the opponent, ambush, and/or going for a quick and possibly a silent takedown. She's not an assassin, however, since she finds it disgraceful. Or at least that's what she's been taught. She does love to go all Hack 'n Slash style sometimes as well, but either way she keeps herself on top of the situation.\n\n-Let me say more is coming most likely in the future-\n",
