		["0419002154am51f"] = {
			["character"] = {
				["CO"] = "- /w me if I'm AFK\n\n- Corrections and tips welcome!",
				["RP"] = 2,
				["CU"] = "-A faint smile on her lips.",
				["XP"] = 2,
				["v"] = 8,
			},
			["time"] = 1496776320,
			["link"] = {
				["Laeniah-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://www.instagram.com/p/BTzJikljjl9/?hl=en*Cute art of Laeniah and Snowclaw}\n\n\n{img:Interface\\LFGFRAME\\LFGICON-HYJALPAST:256:256}\n\nThe Kaldorei are known for their close conncection to nature, and having been born in the beautiful lush forests along the Hills of Hyjal, Laeniah Oakshade is no different. \n-----------------------------------------------------------------------------------------------\n\nAt an early age, she grew acustomed to weapons, as with most Kaldorei children. This young girl proved to be a natural markswoman with a hunting bow, having an agile flair. This of course came to no surprise to her mother,  Aliana Oakshade, as she was a skilled Archer for the Sentinels.\n\nThere would be undoubted long periods of absence from her parents, her father being the main hunter/provider for the village, and her mother on duty with the Sentinel Army, meaning Laeniah grew up mostly in the company of her Kaldorei brother and sisters. Despite her mother not being there often, Laeniah looked up to her all the same with admiration and respect. In her absence, Laeniah would practice her archery relentlessly in the forsest's of Hyjal in an attempt to mimic her mother's talent. While she was still young, Leniah was given a bow from her father. The bow's purple-shaded wood twisted and curled intricately like branches and during times of longing for her parents, Laeniah would decorate the bow with purple feathers and carvings of the moon. \n\n{img:Interface\\Pictures\\Winterspring_Memento_256:256:256}\n\nShe demonstrated a closeness to the beasts, particularly to the Sabers, of Hyjal, a quality which did not go unnoticed. As Laeniah matured, her beauty and combat prowess flourished. She proved herself to be a ferocius and cunning hunter, showing outstanding qualities of graceful speed and agility, similar to that of the Sabers she befriended. When the time drew near for Laeniah's Rite of Passage, it was clear to her what markings she would bare - The Claw of the Saber.\n\nHer mother had been stationed in Starfall Village, Winterspring. Whilst on patrol, Aliana noticed a group of young Frostsaber cubs, and with it not being unusual for the Kaldorei to raise Saber cubs from birth, she knew her daughter would do well with such a loyal beast. Aliana returned to Hyjal with a small Frostsaber cub as a gift to her daughter, a companion for her into adult life. As expected, Laeniah grew an unshakably close bond to her Frostsaber, Snowclaw. After recieveing the markings that would frame her face, she stood with undeniable pride with the significance it held for her.\n\n\n*Unfinished*",
				},
