						["AC"] = true,
						["TX"] = "A protective, and loving, Frostsaber can be seen by her side most of the time. It was obvious that the saber has been Laeniah's companion for most of it's life.\n\nIt also appears that Laeniah often communicates with the saber, which further suggests a strong bond between the two. ",
