					["5"] = {
						["AC"] = true,
						["TI"] = "Jewellery",
						["TX"] = "A thin leather strap is fastened to her neck. From it, dangles a small crescent moon which rests above her chest - It was clear this was a mark for Elune.\n\nA series of stud-like piercings could be seen on both of Laeniah's ears, with small dainty chains connecting each one.\n\nWhen Laeniah was out of her archery gear, a thin metal headress can be seen resting across her forehead. The metal appears to curve and intertwine gracefully. In the middle, a small chain leads to a metal silver leaf that appears to be in the shape of a heart - seemingly representing Alor'el.",
