			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{h1:c}{col:618f95}Miyaeacus Blaise, Bastard of a Common man and a Lord's daughter{/col}{/h1}\n\n{h2:c}{col:89b3bb}Through a single eye do I look. Not because I lack the other, but because like that, I have better accuracy when aiming with my bow, crossbow or rifle. I am a marksman, a self proclaimed record holder.\n\nMy mane has been dyed red and cut short to avoid conflicts with it in battle. My body is lean, but muscular. My chest is flat, and I am tall. If I didn't know I was a woman, I'd agree with those that sometimes mistake me for a boy. The scars upon my frame I hide, ashamed of them, of how terrible they make me feel each and every day.\n\nI clad myself in leather and smooth scales in order to give myself the maximum amount of control while retaining some armour to protect myself from easy death. The brass knuckles I carry are my only way of fighting if my enemy comes close. I shall resign myself to death if they come that far, however. Knowing that I am not capable of beating many opponents in close combat.\n\nI am proud, I am stubborn. I believe all should be equal, and no boundaries should exist. In love, in race and all other things.{/col}{/h2}\n\n\n{img:Interface\\TALENTFRAME\\bg-hunter-marksman:512:512}",
