			["zone"] = "Stormwind City - The Canals",
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Armour",
						["TX"] = "Audrey's armour is less that of a protective bulk of heaving metal, and more of an imbrication of tiny scales, a chitinous and tightly-encasing carapace of plates that mesh together into a lightweight yet durable frame. The armour clings rather tightly to her form and seems almost worryingly thin, yet blows glance off her as if they were rain.",
						["IC"] = "INV_Chest_plate_draenordungeon_c_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Jewellery",
						["TX"] = "Curiously, this Death Knight seems well-equipped in the jewellery department. Whilst her face and ears are unmarked, her neck is encircled by a tight necklace, a small gold chain with a chatoyant ruby dangling from it. Two silver rings adorn the middle finger of her left hand, whilst a single gold one is sported on her right pinky finger. She also generally wears an anklet around her left ankle - it seems to be styled after her necklace, the same intricate detail forged into the gold chain as it is into the shimmering ruby set within it.",
						["IC"] = "INV_jewelcrafting_necklace1_red",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weaponry",
						["TX"] = "Audrey is generally equipped with a pair of ornate blades that appear more graceful than deadly; intricate circular cross-guards, large inset gemstones and thin, lank blades that appear as leaf-light as they do razor sharp, more akin to the tooth of a piranha than the fang of a saber.",
						["IC"] = "INV_Sword_99",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["TX"] = "Audrey, notably and distinctly, smells like death. However, this is only noticable from particularly close by: to anyone further than a few inches from her pallid, sickly skin, she appears to smell of roses. A particularly hefty dosage of perfume laces her form, wafting around her as if to mask the underlying putrefaction.",
						["IC"] = "INV_RoseBouquet01",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Voice",
						["TX"] = "Audrey's voice is, despite her occupation, a soft and lilting one - she sounds almost sing-song at times, never quite serious about what she says: some might suggest distance or aloofness, though never apathy. She takes great care in crafting her words, as she does in listening to all those around her - she merely sounds and appears as indifferent as she does emotionless.",
