						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Arthedun's face is scarred by three claw-marks running across his left brow and most of the left cheek. Along his right bicep another jagged scar can be made out; it appears to of been created by the tip of a crude sword or a axe edge. His eyes are deep blue and his voice echos with authority and assurance.\n\nCaptain Averheim's armour appears to shine as if always polished, the leather straps are well maintained and his tabard is uncreased and well pressed. Five scrolls are neatly pinned upon his armour; they are prayers of hope and poems of our land.\n\nUpon his right wrist a small silver chain with a bronze star hanging underneath can be seen; possibly a family heirloom or good luck charm, at his right thigh a cylinder parchment holster is firmly in place; the officer often produces maps or relevant documents from this.\n\nIf out on operations, a water bottle will be secured upon the rear left of his belt along with three brown leather pouches that barely make a noise when Averheim is on the move, the contents are all water proofed inside individual bags. One pouch for medical equipment, one for rations and the last reserved for anything that may be needed on the mission at hand.",
