						["TI"] = "Facial features.",
						["TX"] = "With the contrast to her dark hair her light blue eyes would appear almost illuminated. This could possibly be the first thing you notice when you lay eyes on this woman, as it could possibly be her most prominent feature.\n\nShe has pale, porcelain resembling skin speckled with freckles, especially surrounding the bridge of her nose and apples of her cheeks.\n\nHer face lacks any form of cosmetic products, you can tell by a mere glance that she is young of age. She has rather large, doey eyes, a wide angular jaw, thin lips with a defined cupid's bow and a slim nose with a fairly short tip.",
