			["characteristics"] = {
				["RA"] = "Human",
				["BP"] = "Stormwind",
				["LN"] = "Crathal",
				["MI"] = {
				},
				["FN"] = "Rawera \"Raven\"",
				["RE"] = "Stormwind",
				["v"] = 11,
				["IC"] = "Ability_Hunter_MurderofCrows",
				["PS"] = {
				},
				["AG"] = "17",
				["EC"] = "Light blue",
				["CL"] = "Commoner",
				["FT"] = "\"That girl\"",
				["HE"] = "165",
				["WE"] = "Slim",
			},
			["character"] = {
				["CO"] = "Always approachable. c:",
				["RP"] = 1,
				["CU"] = "Healing bruise on the right side of her face near her jaw. Looks like she had a rough couple of days. Smells of alcohol and seawater, frizzy hair texture. Skin looks slightly sunkissed.",
				["XP"] = 2,
				["v"] = 98,
			},
			["about"] = {
				["v"] = 10,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "A young woman, black of hair stands before you. Her shoulder length hair is usually tucked behind her ears not to be carried by the wisps of the wind and compromise her vision. With the contrast to her dark hair her light blue eyes would appear almost illuminated. This could possibly be the first thing you notice when you lay eyes on this woman, as it could possibly be her most prominent feature.\n\nAs of late she would seem healthier. Although the young woman is still very skinny and slightly underweight she no longer appear sickly or malnourished. The weightgain has granted her fuller cheeks and slight womanly curves to her body. However her thin shape combined with lack of physical exercise yet causes her to have a rather fragile impression. Her clothes are, although far from noble-wear, not all too shabby.\n\nShe has pale, porcelain resembling skin speckled with freckles, especially surrounding the bridge of her nose and apples of her cheeks. Her skin is free from any gruesome scarring, yet a few scratches can be seen here and there.\n\nHer face lacks any form of cosmetic products, you can tell by a mere glance that she is young of age. She has rather large, doey eyes, a wide angular jaw, thin lips with a defined cupid's bow and a slim nose with a fairly short tip.\n\nIf you have this woman in your company she may emit a false aura of confidence with a hint of cockyness, cheeky & rebellious perhaps. Oftentimes her gaze is hollow, lacking any true emotion, yet if you care to dig deeper you may detect an underlying sadness in her eyes from time to time.\n",
				},
			},
			["zone"] = "Stormwind City - The Canals",
		},
