						["AC"] = true,
						["TI"] = "Content",
						["TX"] = "Val's movements are confident and deliberate. Hair at her left temple is growing in silver. Sports a slim scar on her upper lip, left side.\n\nSee \"About\" for image.",
						["IC"] = "Ability_Rogue_Disguise",
					},
					["3"] = {
