						["TI"] = "Elegant",
						["AC"] = true,
						["TX"] = "Val's clothing is immaculately tailored and proper, constructed with the most flattering image in mind while maintaining modesty.\n\nVal wears a fine navy coat over her clothing with silver buttons and embroidery about the edges.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Gear",
						["IC"] = "ACHIEVEMENT_GUILDPERK_BOUNTIFULBAGS",
						["TX"] = "On Val's person, one finds the following: \n- An enchanted, over the shoulder satchel with capacity beyond its physical bounds.\n- A viciously sharp black steel dagger.\n- A small pouch filled with finely crafted but otherwise mundane tailoring supplies\n- A heavily enchanted tome upon her hip emblazoned with two silver succubi cradling a green  gem.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "A Hole in the World",
						["IC"] = "Spell_Priest_Void Flay",
						["TX"] = "Despite being perfectly pleasant company to keep, there's something unnerving about the woman's presence. Those more acutely aware of auras and natures might even come to the baffling conclusion that Val simply doesn't belong.",
