				["v"] = 36,
				["MI"] = {
					{
						["IC"] = "Ability_Hunter_BeastCall",
						["NA"] = "Nickname",
						["VA"] = "Val",
					}, -- [1]
					{
						["IC"] = "INV_Inscription_inkblack01",
						["NA"] = "Scars",
						["VA"] = "Thin, silver. Left upper lip",
					}, -- [2]
				},
				["FT"] = "Lady Luck",
				["HE"] = "5'3",
				["WE"] = "Lean",
			},
			["link"] = {
				["Voiotía-ArgentDawn"] = 1,
			},
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["CU"] = "",
				["XP"] = 2,
				["v"] = 62,
			},
			["about"] = {
				["v"] = 57,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}{col:caf3ff}I look for omens everywhere, because they are everywhere to be found. They come to me like strays, like the damaged, something that could know better, and should, therefore—but does not: a form of faith, you've said. I call it sacrifice—an instinct for it, or a habit at first, that becomes required, the way art can become, eventually, all we have of what was true. You shouldn't look at me like that. Like one of those saints on whom the birds once settled freely. -- Carl Phillips, Swans and Saints\n\n\n{link*http://imgur.com/3T9CLge*Portrait}\n{link*http://imgur.com/4hpB6ow*Full Body}{/p}\n\n{col:caf3ff}Small and elegant, Val endeavors to move with an intentioned, formal sort of grace. Her bearing, manners and dress are practiced and impeccable suggesting a youth spent in a formal finishing school as with members of the Gilnean upper class. As such, she is ever a lady, dressed in comfortable, well-tailored clothing. Speaking with precise ennunciation, her words are usually chosen with extreme care and voiced with an intention to be heard. There are times, however, when the guise of civility slips, and that commanding grace becomes nearly animal.\n\nA mere slip of a girl with only the slightest hint of curves, Val wears her femininity instead in hair so dark it's practically blue that falls to her waist in dense waves. Pale as marble, black ink stands out from Val's skin, covering a majority of her body in beautiful natural motifs consisting largely of plant-life, insects, and hidden eyes, a single geometric eye on her right palm. Icy blue accents dot the designs, appearing to be embedded into her skin, rather than more ink. They flicker slightly with strange, entropic energy - not unlike her eyes, which while often tired and ringed by black circles, are piercing.\n\n\n{h2:c}Notes{/h2}{col:caf3ff}\n\n-- (OOC, Mostly) Val is deep in the midsts of various experiments to cure the worgen curse, using herself as a test subject in this arguably dangerous work. Erratic behaviour and shifts in personality appear to be the most of it, however other symptoms may arise suddenly.\nShe appears to exercise extreme control over her worgen form, rarely turning completely. Her hands tend to grow claws under duress.{/col}",
				},
			},
