					["TX"] = "Celmisia looks to be in the prime of her life, around her mid twenties. She stands at about average height for her race and possesses a lean and toned physique. It is obvious from looking at her that she spends a lot of time looking after her body and general appearance. Her dark skin is virtually blemish-free, save from a number of lashing scars on her back. Celmisia has attempted to cover up these scars with an assortment of tattoos which seem to blend almost seamlessly into one large tattoo spanning the length and width of her back, however the scars remain visible to a certain extent. Celmisia also sports a sleeve tattoo down her right arm, from her shoulder to the back of her hand, and a few smaller tattoos on her left arm. Celmisia's hands are quite coarse to the touch, suggesting they have seen a lot of manual labour in her lifetime.\n\nShe possesses long, brownish-blonde hair which is always very neat and usually tied back in a tight ponytail. Her kind eyes and soft lips compliment her youthful appearance. She has numerous piercings including her ears, left eyebrow, left nostril and belly button.",
				},
