					}, -- [9]
				},
				["FT"] = "Necromancer || Knight of the Ebon Blade",
				["BP"] = "Argus",
				["WE"] = "Slightly Muscular",
			},
			["zone"] = "Stormwind City",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Viikuul has slightly more muscle than the average Draenei woman, as well as bright white hair and trademark Death-Knight-Blue eyes. She has a large scar on her waist, reaching from hip to hip, as well as some scars across her upper arms, and a single horizontal scar on each elbow and a circle around her left shoulder.\n\nHer face shows very few signs of decay, and her teeth are kept well. It is clear that she takes personal hygiene very seriously. Because of her attention to her hygiene, Vii does not smell as much of death as her fellow Death Knights, though the smell still lingers for those close enough to her.\n\nVii's veins are filled with tiny spiders, kept alive by her necromancy. When wounded, these spiders sew up her cuts with their silk. Vii also ensures to keep a Bloodworm in her stomach, filled with magically empowered blood that she can use to heal up.",
						["BK"] = 15,
					},
					["PS"] = {
						["TX"] = "Vii is cold and uncaring towards those that have not earned her favour. Once her favour is earned, however, you could not find a more devoted \"friend,\" willing to fight for those close to her. Most of the time she is brutally honest, and cares not for the opinions of others. Some may see this as a good thing, until they realise her opinions are rarely positive.\n\nWears her non-saronite armour when around Living Civilians, due to the adverse affects on the Living from Saronite. Not because she cares for the living, but because she does not wish to start a witchhunt on herself for killing or corrupting the Living.\n\nAfter being in the employ of a skilled, albeit eccentric and nefarious, Doctor, Viikuul has picked up a surprising amount of medical knowledge concerning the Living.",
						["BK"] = 12,
					},
					["HI"] = {
						["TX"] = "Once a Vindicator of Argus, Viikuul was bested in battle with the Scourge in Northrend, and was turned into a Death Knight. She focused on raising the Dead to fight by her side, and various other ways to use corpses (an abundance of which could be found in Northrend) in combat.\n\nFighting on the side of the Lich King, her mind was finally freed from Arthas' grasp by the Knights of the Ebon Blade, who found her in Zul'Drak. She then joined them on their expedition to Icecrown, and stayed with them, defending the Shadow Vault.\n\nAfter joining with the Swords of the Ebon Hold, Vii once had to participate in a mission in her non-Saronite robes. The result was her near second-death. Because of this, she forged new armour made of hard bone and chitin from Nerubian carcasses, which she wears around the Living.",
						["BK"] = 19,
					},
				},
				["TE"] = 3,
				["BK"] = 5,
				["MU"] = "ZoneMusic\\IcecrownRaid\\IR_CrimsonHall3",
				["v"] = 14,
			},
			["misc"] = {
				["ST"] = {
					["1"] = 3,
					["3"] = 3,
					["2"] = 3,
					["5"] = 4,
					["4"] = 0,
					["6"] = 1,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Boss_LadyDeathwhisper",
						["TX"] = "This Draenei is clearly a Death Knight, with the trademark blue eyes and echoey voice.\n\nUndeath has turned her hair to a bright white colour and her face seems relatively free of decay, her teeth also seeming almost pristine.\n\nShould her stomach be on show, one would notice a large scar running across her waist. Her elbows also show a single scar across each one, and her left shoulder has one the entire way around.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "That Stern Glare",
						["IC"] = "Achievement_Ladydeathwhisper",
						["TX"] = "This Draenei seems to always have a very stern look about her, showing very little emotion aside from contemptment.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Armour",
						["IC"] = "INV_Chest_Plate_RaidDeathKnight_K_01",
						["TX"] = "Even accomplished Blacksmiths may have trouble discerning what metal Vii's armour is made from, as it is no metal at all. Her armour is in fact made from hardened Bone and Chitin of Nerubian Crypt Lord carcasses, enough to withstand arrows and a few blade hits.\n\nOne might notice a slight blue glow in the eyes of the skulls that adorn her shoulders and helmet. Should any divination be used, the caster would learn that this glow in fact comes from a collection of souls kept within the armour itself.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Remorse, Greatsword of the Damned",
						["IC"] = "INV_Sword_154",
						["TX"] = "Vii wields a hefty Runeblade, with several runes down both flats of the blade, with a skull adornment at the hilt. Within the skull is a Soul Core, used to store the souls of the fallen. The core is visible through the eyes of the skull.\n\nThe blade appears to be made from Tempered Saronite, and the Runes that adorn it appear to be of the Unholy Discipline, allowing for the control of the Undead, and the infliction of diseases.",
					},
				},
				["v"] = 52,
			},
		},
		["0529062225G4a2u"] = {
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["v"] = 45,
				["XP"] = 2,
				["CU"] = "Drawing on a piece of parchment.\n\n• Probably looking a bit lost.\n• Long-titled book tied to his belt.",
			},
			["time"] = 1496173305,
			["link"] = {
				["Cestello-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 5,
				["BK"] = 18,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffc7a3}Argent Archives Page: {link*https://www.argentarchives.org/node/153571*https://www.argentarchives.org/node/153571}{/col}\n{img:Interface\\QuestionFrame\\answer-InnAlliance:512:256}\n{h2:c}{col:161616}Dean Cullen{/col}{/h2}\n{h3:c}{col:161616}Human Appearance{/col}{/h3}\n{col:ffffff}Though tall, Dean stands out as a youngling due to his lanky physique and child-like expression. Large green eyes gazing about at everything curiously, his face freckled, and a buck-toothed smile.\n\nHis hair is a bright brown tone, reaching to his lower back in a tail tucked by the back of his neck. Well cared for, though occasionally tangling up with itself. Some stray hairs are seen by his upper lip with the same colour.\n\nUsually seen in his training outfit, consisting of lighter leather and a pair of sturdy plated boots, along with a Gilnean tabard that is one or two sizes too large for him.\n\nOften carrying a light practice sword with him, having it swung across his back in a leather strap. Can also be seen with a book by his belt, titled \"Hymns and Prayers of the Clerics of Northshire\".{/col}\n\n\n{h3:c}{col:161616}Worgen Appearance{/col}{/h3}\n{col:ffffff}Though somewhat shorter than most other male worgen, Dean still reaches their height since his stance isn't hunched whatsoever. In fact, he'd almost look more like a female of his kin.\n\nSlender, almost lanky, with a fur-tone the same as his hair colour, except for the lighter patches by his hands, chest and snout. His fangs, sharp-looking on either sides of his snout, the ones up front somewhat sturdier.\n\nClear green eyes peek out at people with curiousity and lopsided ears flick along with every noise that seems out of the ordinary. His nose twitching every now and then at the scents around him.{/col}\n\n",
				},
			},
