			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Brown, shaggy hair slightly covers a strong, cheerful face. Glinting icy-blue eyes, elegantly set within their sockets gaze upon the world in-front of him.\n\nSomewhat thick eyebrows and a maintained stubble of a beard.\n\nThis is the face of Albrett John Fayne. \n\nHe stands tall among others, despite his average frame. Broad of shoulder, strong physique with vascular arms.\n\nThere's something puzzling about him, perhaps it's his charming demeanour or perhaps it's simply a feeling of a man with an iron will.\n\n\"Never in my life have I seen any other person whose appearance - how shall I put it - was so completely dominated by the eyes. They were the light eyes of his mother, but her somewhat staring, penetrating gaze was even more marked in the son and had even more force and expressiveness... After he first came to our house and I introduced him to my mother, she said to me in the evening, 'What eyes your friend has!' And I remember quite distinctly that there was more fear than admiration in her words.\"\n\nIf you ever saw his bare and hairy chest it would witness of years of violence and hunting. Scars from the claws of a bear stretches from one shoulder down to the middle of his back. Small circular scars where bullets have made their entry and exit. Signs of whipping, flogging and cuts from swords and sabres.\n\n",
