			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "One described as a rather curvacious woman, the lack of sleep, a proper diet and too much coffee, work and wine, has left her thinning down slim. Her long raven hair is often tied up with the black ends brushing down along her spine, almost nudging her waistline in length. Her eyes are framed with charcoal lines and burning emerald green in stark contrast to her dark color.",
						["BK"] = 17,
					},
					["PS"] = {
						["TX"] = "Temperamental. Fiery. Harsh and blunt. Seems to prefer her own company. An infuriating woman to many.Smirks rather than smilesand bluntly asks instead of sugar coating.",
						["BK"] = 17,
					},
					["HI"] = {
						["TX"] = "Offical records of her history includes; \nService in the Northrend campaign, mainly Borean Tundra as the chief surgeon for the medical team. \nSurgeon for the Royal Navy, with a few reprimanded cases on record.\nCurrently the quartermistressof the Dainty Damsel.\n\n",
