			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Appearance{/h1}\n\nThis draenei stands tall at just below average for her kin. Her skin is mostly unmarked and in pristine condition. She takes great care in her looks. Her long nails as well as her beautiful black hair stands out. Her lips are slightly darker than her skin. Her eyes are azure of color and glow brightly. Behind the innocent looking draenei there is another thing. She is surrounded by a shadowy aura, quite a potent one. Her form is complimented by her curves, a tight peachy rear and slightly above average bossom.\n\n{link*http://imgur.com/TZbps4X*Picture of Phaleri}\nPicture of Phaleri: Http://imgur.com/TZbps4X\n\n{h1:c}Personality{/h1}\n\nHer personality is rather gentle, she likes to think things through and come to compromises if things would be different than she had in mind. She is a proud female who is not scared to be in the center of attention. If she is in conversation with someone she might seem distant at some times. She chooses her words with great care.\n\n{h1:c}History{/h1}\n\nPhaleri is currently attuned to the shadow, she abandoned the light after a critical event. She still was a battle-mender, but at one point one of her closest friends got injured and she was not able to keep her alive using the light in attempt to mend her. Her friend passed away and this broke her hearth and Phaleri as a person. A couple of months later the same incident happened but this time it was an unknown person to her. Yet the injuries as well as the condition was the same. This reminded her of the tragedy that had happened months before. Curious to see wether she was able to keep the injured soldier alive, she attempted to mend her using the shadow. To her suprise she actually managed to keep the soldier alive. Because of this event she gave up on the light completely. Knowing the power of both sides she will never forget what the light is capable of. It changed her personality in time from being a very shy person to a more selfish and in a way more dark.\n\n\n{h1:c}Work{/h1}\n\nThere would be IC Flyers around the city, If you come across one, She is promoting her massaging business (Not an ERP invitation, Legit business.)\n{link*http://tinyurl.com/zhzlrek*IC Flyer}\n\n\n\n\n\n\n",
