					["TX"] = "Baroness Velanora Maribell Blackwood is a Gilnean beauty without match. Her raven black hair falls like obsidian water from her hair, a striking contrast from her milky white skin, showing she is not much outside in the daylight. Her plump, luscious lips are coated with a deep red lipstick, hiding a white, pristine smile. Always found with only the most expensive silk, gowns and dresses adorn her figure which seems crafted to perfection, slender arms and hands often folded under her enormous, voluptuous breasts which defy gravity, firm with yet a good bounce to them. Her waist is often strapped in a tight sitting corset, giving her an hourglass figure while cupping up her breasts, only enhancing her enormous cleavage.\n\n\nHer long, slender legs walk with authority and determination with every step she takes, often adorned with black high heels, only making her posture that more prominent while sticking out her large, bountiful ass which remains tightly contained within her dresses.\n\nVelanora is the youngest in a sister sibling group of four, born to this world by two loving parents, Vincent and Victoria Blackwood. After her parents tragic demise, her sisters mysteriously began to vanish one by one, the disappearances never solved, but believed to be connected with her parents death. This ended up leaving Velanora as the only heir to the Blackwood name, a family which rules great territories in Gilneas, having gained their riches mainly through wine and other nontraditional routes.\n\nVelanora hunted down her parents’ killer, but was unable to defeat the magus on her own with her powers as a rivalling mage. Driven by vengeance, she cast down her tomes of arcane learning and began to delve deeper and deeper into dark magic and fel, slowly but surely mastering the arts of summoning powerful demons. She quickly realized this was her calling, the Mistress of her summonings, the Ruler of her family legacy. And here, she was Queen.",
