			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Physical Appearance{/h1}\n\nA rugged, broad and tall figure to the average human being, the sturdy individual may strike you as someone who doesn't enjoy social interactions due to his unsettling stare, often mistaken for a glare with his empty lime green eyes and an unfriendly demeanour.\n\nOther than that, one probably notices his partially-disfigured face first, a good study would reveal it was due to being scorched at the side. Naturally, his facial features are embraced by unkept ebon thick hair connected to an over grown grizzly beard.\n\nHowever, upon finer inspection, there's scars with many stories to tell if one cares to ask.\n\n{h2:c}Personality{/h2}\n\nA trafficker of mostly all sorts, described as a man with a black heart whom disguises himself within society as a pawn broker.\n\nKnown to be violent and coercive due to his controversial ways, one could say he has sociopathic tendencies with his impulsive urges therefore he is quite unpredictable.\n\nSince young, he's been ambitious and through his peer group he naturally developed ways to be cunning, learning to be silver-tongued he has come to terms with the fact that violence doesn't always solve his problems.\n\nMr. Clarke is arrogant, intemperate and seemingly apathetic yet surely such an individual wouldn't have no friends. However, this brute does have good traits.\n\nLuckily, he has humour as he can be quite witty, selectively shows loyalty and respect to those he deems strong and can hold their own amongst coins with a code of 'honour' which all in all keeps him from being killed.\n\n{h3:c}History{/h3}\n\nOnce an artisan, particularly a builder within the Stonemason's Guild back as a young man who assisted with the reconstruction of Stormwind City after the Second War. \n\nAs history goes, refusal of his wages due to certain noble families' political views within Stormwind City, led him leaving a fixed city with a broken spirit. \n\nAngered and betrayed as many others felt alongside him, a group of blue collar workers now turned to the life of chaotic crime within a renegade faction which, at the time, seemed to demand true justice.\n\nWhen the Defias Brotherhood was only but a few thousand, he led the life of a marauder as they raided villages and ambushed merchants, looting and kidnapping by any means necessary. \n\nEventually such a wicked lifestyle filled with paranoia and chaos caused him to want to escape, physically and mentally through alcohol abuse and cutting ties to find a different life. \n\n(The details of what made him join, what he did after leaving and now are left to those willing to learn through interaction!)\n\n{img:Interface\\LFGFRAME\\LFGICON-DEADMINES:256:256}",
