						["TX"] = "Having a visible labret tongue pole piercing with an iron orb at each end!\nWhen speaking, can be seen if an eye would ever stare into her maw!\n\nHaving some nice and neat' dwarven crafted earrings, thick in size, inscription with dwarven runes and letters most likely! Ask her about them!\n",
