						["TI"] = "Equipment!",
						["IC"] = "INV_Misc_Bag_19",
						["TX"] = "Most likely having two belts, one with weapon sheathe and vial sockets!\n\nThe other belt is resting underneath the sheathe belt, she keep her tool belt close, having smaller archaeology items, small pouch if not a small knapsack, tiny mining pick and a wooden mug, always hanging and bouncing against her hip side!\n",
