			["about"] = {
				["v"] = 3,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:ff2c9a}Helga is one of the most beautiful dwarven ladies out there, young and fine, has the strength needed to rival some orcs but still she have the exotic looks of a jewel from Uldum!\n\nHelga, born in Loch Modan, kinda explains her more tanned skin colour compared to the other in the capital mountain of Ironforge!\n\nShe has gotten the odd looks from her mother whom had the hill dwarven type of a look, tanned and more southern exotic looks as if she was a pirate or something, but no! She was just the hag that took care of the local rams.\n\nHer hair would be in a thick brown colour, glimmering with a bronze-like reflection, smooth in touch but easily ruined and do beware!.. \n\nHer head figure is just perfect, almost little cute! Well, always cute! Followed with her deep purple eyes, has some shade and some minor \"make-up\" to cover it but most of it is just her natural colour!\n\nHer lips be thick and dark, but her smile flashes a prestine pair of teeths that seems to just bring a bright light to everyone, BUT she might be seen to have gotten some of those.. Shark teeths? Vampire teeths? Just seem to have something like such! Nothing dangerous!\n\nHer decorations around her body would be mostly the ear piercing rings, thick in size, thicker than usually, clearly dwarven made with their native language inscribed, even better, she made them herself, yes!\n\nBeautiful jewelry she would wear, sometimes with gems and sometimes just plain piercings, one that sticks out well is the one through her tongue, a labret piercing with a pin through, one orb in each end!\n\nHer curvy, delicious body shape explains her past with works in battle and being around others such working in taverns!\nThe curvy looks clearly attracts all kinds of people and races, hourglass in form!\n\nCarries two hefty pair of breasts as any of her kin would do, but her strong body and back would be what holds them up, and mostly held back by some sort of bra! A mighty one that is!\n\nOnly minor scars covers her body, as she has been trying to avoid fighting unless really necessary, but clearly muscles can be seen if she really wish to squeeze them out from her more plump form!\n\nSame as the top, her hips and thighs sticks out well and shows her curves just the way everyone would like (most atleast), able to be swift in short distance, increadibly fast in a sprint range, but also quickly she would get tired if that was made, but those in her path.. MAY the beards and tits of the ancestors take care of them.\n\nBesides.. SHE CAN FLATTERN STEEL WITH HER THIGHS!{/col}{/h3}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{link*http://imgur.com/a/wpwdt*Commission of Helga!}\n{/h1}",
