				["PE"] = {
					["1"] = {
						["IC"] = "Achievement_Leader_King_Varian_Wrynn",
						["TI"] = "Appearance",
						["AC"] = true,
						["TX"] = "Before you stands a middle aged man with a well build body. His long red/grey hair has been tied up in a ponytail, almost reaching his waist level. His red/grey beard hangs under his chin. He wears an eyepatch over his right eye with some visible scars surrounding it. He also took quite a hit to the face, because there's a big scar across it. The scar runs from the top left corner of his forehead, down to the nose and end just above his beard, in the bottom right corner.\nHe always has a stern look on his face, but can often been seen with some sort of a smile.",
