						["TI"] = "Mechanical Left Arm",
						["TX"] = "His new left arm is made out of living steel, that can transform into many things. \n\nMade by the incredible gnome engineer, Tinyc Steamwhistle.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
