			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Wild Appearance",
						["IC"] = "Ability_Druid_ProtectorOfThePack",
						["TX"] = "Gwyn is an wild looking worgen with athletic but slightly malnourished body, messy mane and tangled, brown fur with a white strip. Her snout is long and slim. (More in about page, Including drawing of her.)",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Forest scent and nature connection",
						["TX"] = "Gwyn smells like forest. Its rather pleasant... most of the time. But trained people can feel Gwyn connection to nature.",
						["IC"] = "INV_Misc_Herb_JadeTeaLeaf",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Wild attires",
						["TX"] = "No matter what she wears its usually a little bit dirty. She usually wears her green vest, pants and gloves which are \nreinforced with drake leather. Gwyn also often wears a strange skull helmet. She also have two, capacious pockets.",
						["IC"] = "INV_helm_Leather_RaidDruid_P_01",
					},
					["5"] = {
						["IC"] = "INV_Misc_MonsterFang_02",
						["TI"] = "Voice",
						["TX"] = "Gwyn have throaty voice full of neutral growls and snarls, seemingly sneaking in naturall.",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Animal friend",
						["IC"] = "Inv_Pet_Frostwolfpup",
						["TX"] = "For some unknown to anyone reason, Gwyn is good with animals. She like them and they like her. Some creatures even follow her sometimes.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 0,
					["4"] = 1,
					["6"] = 1,
				},
				["v"] = 57,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:Ability_Racial_Viciousness:25}{/h1}\n{h2:c}{col:59873f}Remember that beast in shadow might be your salvation{/col}{/h2}\n{h1:c}{link*http://i.imgur.com/nCWkk6V.jpg*Gwyn commison!}{/h1}\n{h3:c}(Link to artist deviant art at the bottom){/h3}\n{h1:c}{col:56a33e}Appearance:{/col}{/h1}\n{col:ffffff}\n{h3:c}A pleasant scent of forest always accompanies Gwyndori. For the majority of people it might just be smell of freshly cut grass but someone with good nose would smell bushes, trees, grass and all kind of folliage and  forest smells. \n\nShes smaller then your average worgen woman. \n\nGwyn’s fur is bright brown with a snow white stip starting from her collarbone, going through her chest, stomach, abdomen and ending on her inner thighs. Her fur is also scruff and not taken good care of. It looks as if she grooms it on a regular occassion, but it’s still mess. An bornw feathers with black endings sticks out from her fur. Sometimes they fall off.\n\nHer snout is rather slim and long, ending with deep black nose. A small scar or two would hide on it. She has forest green eyes that are usually inspecting her surrounding.They would constantly twitch as if she would be listening to her surroundings. And tip of her left ear is missing! \n\nGwyn’s mane isn’t maintained too well; She grooms it carelessly. Some tangles or strands of hair can stand out here and there. Small, bright wooden carvings are woven into her mane, which are quite distinct. They represent the wolf heads, trees, fangs, claws and all kind of carvings inspired with the forest and its inhabitants. Another thing sticking out from her mane is A rough, dark iron ring, woven into a lock of hair\n\nHer arms and shoulder are toned but by no means muscular. There isn’t much to show considering it is hidden under her thick fur. Some small  scars can be seen here and there but usually her fur conseals them. Her arms end in sharp claws that look well used.\n\nGwyn’s chest is decorated with pair of smaller than average breasts. Under them there are clearly visible ribs as if she wouldn’t eat too much. Yet again, few small scars can be seen on her chest and back. An nasty but small burn scar is visible on her right side, udner the ribcage.\n\nHer stomach and waist also bears mark of slight malnutrition. Gwyn stomach is rather flat and her waist a little bit slim. Worgen hips and thighs are shaped for running, with almost visible athletic muscles. \n{/col}\n{/h3}\n\n{img:Interface\\LFGFRAME\\LFGICON-THEBATTLEFORGILNEAS:256:256}\n\n{h1:c}{col:37762b}And here you can see Gwyn in her natural habbitat, what a fine creature she is.{/col}{/h1}\n\n{h1:c}{col:c30909}W.I.P{/col}{/h1}\n{h3:c}{link*viviennenarr.deviantart.com *Gwyn commision artist deviantart.}{/h3}\n\n\n\n{h3:c}Secret garden gnomes collector.{/h3}\n\n\n\n\n\n\n\n",
