			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Cineal 'Cu' Conri{/h1}\n{h1:c}Appearance{/h1}\n{h1}Human{/h1}\nA rough looking muscular man of middling height appearing to be mid to late twenties with messy dark brown hair which almost looks black, it doesn't seem to be styled in any particular direction. His eyes are a light green colour which is contrasted by the bags under his eyes which are an off shade of gray and his dark thick eyebrows. He often has dirt all over him and his face is dirty nearly all of the time with rough looking skin on his hands and feet, under which his skin is quite pale. He twitchs his nose and flares his nostrals a lot of the time without knowing it depending on how he's feeling. Like the rest of his skin his lips are a pale red and almost blend with the rest of his skin despite being pretty full. Not that you'd really get a good look at his lips because of his long messy facial hair. \n\n\n{h1}Worgen{/h1}\nA tall muscular gray worgen with messy looking matted fur which looks very much in need of a brush. His ears and long and pointy one being nearly constanly erect and the other constantly drooping down. His light green eyes are large and tend to shift around. His long snout is helmed by a large canine nose, long white pointy fangs and a long furry beard drooping under. \n\n\n{h1}Barn Owl{/h1}\nIn his flight form Cu takes the form of a large gray barn owl with large piercing eyes, razor sharp talons, long ruffling feathers with some purple markings on his wide wings and back.\n\n\n",
