					["5"] = {
						["AC"] = true,
						["TI"] = "Engagement Ring",
						["TX"] = "A beautiful ring rests on her right ring finger, the design and position should make a statement clear, she is spoken for.",
						["IC"] = "INV_Jewelry_Ring_10",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Magical Aura",
						["TX"] = "An aura of magical potency permeates the air around this Gnome for those capable of detecting such, clearly capable of using and wielding the Arcane.",
