			["time"] = 1496527248,
			["zone"] = "Stormwind City - Mage Quarter",
			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "Achievement_Character_Gnome_Female",
						["BK"] = 9,
						["TX"] = " Imixie stands a little over 2 foot 7 inches in size, making her short even by Gnome standards. This diminutive size seems not to bother Imixie as she manages to stand aloof and haughty in the presence of all. \n\n Her face is smooth and unblemished, soft features all around whilst her skin is on the pale side tending to remain indoors it would seem. Always seen with a monocle of clouded glass covering her right eye preventing anyone from seeing through it. Though should she reveal it, it would glow a sickly fel green and be very reminiscent of a Blood Elves eye, fel green in colouration.\n\n Imixie dresses consistantly in robes of varying colourations and styles though underneath these she is very skinny and feeble looking, not a physical combatant in the most ludicrous of minds.\n \n Her hair is kept meticulously clean and styled at all times unless in situations where no time has been allowed for this 'ritualistic' hair doing every day. (Shock horror, sometimes she is seen with her hair simply ponytailed.)\n\n Equipment and Clothing stats:\n\n - Robes, interchangeable at a whim though every one is finely made and comfortable for her to wear.\n - She has a selection of staffs that she changes depending on her robe selection, though in her battle robes she is seen with her prized posession; \n Dracon Ban'dinorial - The staff is a masterpiece of construction, elegant and carved with runic patterns all along the shaft and up to the headpiece. The true centrepiece of the whole construction is the large gemstone that floats in place, it appears to be unnatural and if the inspector has the ability to detect it, the gemstone contains considerable amounts of arcane energy. And if one is familiar with such things it appears to be a focusing crystal. She recovered it during the Nexus Wars and uses it to devestating effect by amplifying her potent spells to unnatural levels.\n\n Rings:\n\n - A beautiful engagement ring rests on her right ring finger.\n - A Silver band rests on her left middle finger, it folds around into a signet, an image of a raven flying over a 'portal', an amethyst lies in the portal giving it a purple coloration.\n - A gold band set with an emerald rests on her left thumb.",
					},
					["PS"] = {
						["IC"] = "Ability_Kaztik_DominateMind",
						["BK"] = 5,
						["TX"] = " Bullet points will be listed for generic traits exhibited by the species known as Imixie, these are no means the whole list but are generic and most often observed whilst she is within her natural habitats:\n\n - Sarcastic\n - Cocky\n - Self-centered\n - Light-hearted\n - Jovial\n - Firm\n - Well spoken\n - Calm\n\n Now I know some of you are scratching your head and saying, some of these traits are mutually exclusive. Yes. I know, she changes her outward appearance and attitude depending on who she is speaking to.",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_07",
						["BK"] = 2,
						["TX"] = " Brief overview of history:\n\n - Born Gnomeregan 132 years ago.\n - Moved to Dalaran 98 years ago.\n - Moved to Stormwind 78 years ago.\n - Fought in First War, relocated to Lordaeron post destruction of Stormwind.\n - Fought in Second War, relocated to Blasted lands and eventually Draenor pre-destruction of Dark Portal.\n - Survived the 'Outlands' and returned to Azeroth post-Portal reopening.\n - Transfered to the Seventh Legion and present at Wintersgarde during the Northrend campaign.\n - Retired from official Military service post Northrend.\n\n This is a very brief overview of 'Mixies past adventures and exploits and by no means is it in-depth at all, for any interactions you may ask her about it.",
					},
				},
