						["TI"] = "Scarlet Champion",
						["IC"] = "INV_Chest_Chain_07",
						["TX"] = "The man's armour and tabard clearly indicate that he is part of the Scarlet Crusade faction.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Shield",
						["IC"] = "INV_Shield_05",
						["TX"] = "Thaldrin is always seen carrying a shield on his back. The shield is white, with a crimson embellishment on the outside, and the Scarlet flame in the centre.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Holy Light",
						["IC"] = "Ability_Malkorok_BlightofYshaarj_Red",
						["TX"] = "A red glow can be seen eminating from his blade. The longsword is infused with Holy Light, which has a crimson hue due to his unwavering dedication and loyalty towards the Crusade.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Brand Mark",
						["IC"] = "Ability_Mage_FireStarter",
						["TX"] = "The bottom part of the Scarlet sigil can be seen branded into his left arm, the rest is covered by his chestpiece.",
					},
				},
				["v"] = 22,
			},
			["time"] = 1496767909,
			["link"] = {
				["Thaldrîn-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\ScarletCrusadeLogo:256:256}\n{col:ffffff}Just by looking at Thaldrin, you can tell which faction he's aligned with, as he is clad in crimson armour and proudly wears the tabard of the Scarlet Crusade over it, which is stained with a few specks of blood. A rather distinct mark  appears to be burned into his upper right arm when he rolls up his sleeve. The brand of the Scarlet Flame.\n\n Due to his red, winged plate helmet covering his head and a large portion of his fairly pale face, some of his visage cannot be seen. What can be seen however are his greenish-blue eyes, under his bushy eyebrows, which are chestnut in colour. His nose is quite small, and very straight. and as your eyes descend upon his mouth, you see that his small lips are surrounded by a little stubble, it looks rather neat and well trimmed. His face bears no wrinkles, and he looks rather young overall. His face usually depicts a serious expression.\n\n When Thaldrin takes off his helmet, his face is fully revealed and the front of his brown, shiny hair can be seen cascading down either side of his face and onto his shoulders, framing and complimenting his visage. What's very noticeable is that at least a third of the right side of his face is covered in red burn scars. The scars seem to extend down his neck and proably even further, possibly explaining why he's rarely seen without his helmet. Whilst the burns haven't disfigured his face, they're not very pleasant to look at.\nThe back of his hair flows down past his shoulders and blows slightly in the wind when he walks.\n\nThaldrin wears fairly heavy looking plate armour. His shoulderplates are quite large, but they fit him well. He wears a crimson chestplate which matches the shoulderplates in colour. Only the parts of the chestplate covering his arms can be seen, as his tabard cascades down his torso, covering his chest and his back. Thaldrin's hands are covered by cuffed gauntlets made of plate, which are scarlet in colour and bear a slight lining of patterned gold near the top.\n\n On his waist, he wears a red belt over his tabard, securing it to his body. On the belt, he carries a sharp, scorched piece of steel that bears the scarlet flame towards the base. As well as this, he has a short piece of rope, possibly used to restrain people, and a small pouch containing food rations. Thaldrin's legguards are also crimson and white, matching the colour of the rest of his armour pieces. As you look down towards his feet, you can see that he is wearing sturdy looking cuffed plate boots. The boots almost mimic the appearance of his gauntlets, as they share the same colouration, and are both lined with patterned gold.\n\nThaldrin carries a sword at his side. The blade of the sword is pearl white, and the edges appear to be very sharp, as is the end of the blade to ensure that all attacks with the blade result in the receiver becoming severely wounded. The lack of any scratches or signs of wear on the blade indicate that it is very well kept. The hilt of the blade is made of shiny looking oak wood and gold. When not in use, the blade is kept inside a decorated crimson and gold scabbard. He also carries a shield on his back. The shield bears the Scarlet flame, and the edge of it is the same colour as the centrepiece of the shield, which is red, matching the rest of the armour.\n\nAs you glance back up at his upper half, you notice him staring back at you, his eyes filled with zeal and a stern expression upon his face. {/col}\n\n{img:Interface\\LFGFRAME\\LFGICON-SCARLETMONASTERY:256:256}\n\n{col:ffffff}Thaldrin enjoys inflicting pain upon the undead, as they took away the land which he once called home and turned it into a festering, plagued cesspool. Whilst 'highlord' Tirion Fordring sits idle in Mardenholde keep allowing the forsaken to brew their plague, the Scarlet Crusade take the fight to the undead and all that seek to harm the once great kingdom of Lordaeron.\n\nThaldrin wishes one day to see the false Queen's head on a pike, and Lordaeron reclaimed under the Scarlet Crusade's crimson banner.{/col}\n\n",
				},
