				["T1"] = {
					["TX"] = "{h2}Appearance{/h2}\n{col:ffffff}Before you stands an average Dwarf in terms of height and a bit of a larger tummy compared to the norm of his kin.\nA young outlook can be seen across his ice blue eyes that are covered up by some basic glasses, the top of his head is fully bald and his blond and fuzzy beard is in a dutch style.\nHis clothing is rather normal, across his waist is a few pouches that hosts various smaller equipment the dwarf decides to carry with him. \nHe also carries a satchel slung across his shoulder that is the host of a book that he carries with him almost everywhere he goes.\nIt's not unusual to see him carrying around a leather case upon his back.{/col}",
