			},
			["misc"] = {
				["PE"] = {
					["5"] = {
						["AC"] = true,
						["TI"] = "Assorted Weaponry",
						["IC"] = "ability_rogue_restlessblades",
						["TX"] = "Usually found deep within both of Bigby's pockets is a thick set of knuckledusters - painted with a dark shade of grey, which is beginning to fall off from the weapons in flecks, revealing the dulled metal beneath.\n\nOn the sharper side of weapons, a metal spike is often found stashed beneath his jumper - tucked into a small leather sheathe on the inside of his trousers - the weapon's grip consists of a piece of wood wrapped in leather multiple times to allow a decent hold, the weapon is little more than a coward's solution.\n\nRarely, Bigby will carry a meat cleaver - the edge coated with specks of rust and is far blunter than the usual knife. The wooden handle is barely long enough to be held by the average hand but grooves in the grip allow a proper grasp on the tool. ",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Bling",
						["IC"] = "TRADE_ARCHAEOLOGY_MITHRILNECKLACE",
						["TX"] = "Around Bigby's neck lies a silver chain, clearly of a high quality. The metal, despite the cost of it, lies unclean and grimy, clearly unwashed for a good few years. Around his fingers are a number of rings, mostly gold or silver - in the same state of cleanliness as the chain asides from a thin golden wedding band on his left ring finger, which is shined to a gleam.\nAll of these items are hidden, the chains beneath his shirt and rings beneath gloves - their outlines being the only hint to their existance.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Double-Barrel",
						["TX"] = "While he doesn't often have it with him, Bigby does own a double-barreled shotgun, possibly the most expensive thing he owns. \nThe wooden parts of the gun are composed of walnut, but it seems to be missing it's stock entirely. The metal barrels are sawn off just after the forend, making the weapon far easier to conceal. \nThe trigger mechanism operates on a two-trigger basis, allowing the use of both barrels at once if needed.\nA small engraving near the breech reads the name \"Allina\".\nDeep within Bigby's pockets a handful of paper shotgun shells can be found.",
						["IC"] = "INV_Weapon_Rifle_08",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Smiley",
						["IC"] = "Achievement_Halloween_Smiley_01",
						["TX"] = "A brutal grin is carved into the left side of Bigby's face, quite obviously in the recent past. The cut extends from the corner of his mouth almost until his cheekbones, smaller newer scabs are dotted around, marks from a shoddy job at stitching that has only recently been removed. \nHis beard only partially covers up the scar.",
					},
				},
				["ST"] = {
					["1"] = 3,
					["3"] = 1,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Bigby Farndon is a man of height, sitting at just over 192cm (6'3\") - boasting broad shoulders and a wide chest, along with a reasonable amount of muscle. Clearly the man takes a decent amount of care of himself in the exercise department \nA slightly crooked nose sits in the middle of his face, obviously taken a number of beatings in Bigby’s life, seeing many-a-break.\nDark brown eyes which are often bloodshot – be it from recreational drug use or an infection is yet to be proven – with heavy bags beneath them both.\nThick bushy eyebrows loom above Bigby’s eyes, surprisingly visible for a man with blonde hair.\nA life spent running owes to an above-average speed and stamina when it comes to a sprint, an amount of muscle has been built up around his lanky legs.\nBigby has dirty blonde hair, which is more often than not greasy – having not seen a razor for upwards of three months, if investigated thoroughly it can be seen that there are streaks of grey within his hair. \nA thick beard wraps itself around Bigby’s chin, similarly streaked. The beard, despite being dirty, seems far better maintained than his hair, obviously trimmed semi-regularly. \nA few wrinkles outline Bigby’s face, hinting at a life lived too fast too early – adding a few years onto his appearance.\nUnlike most men in Stormwind, Bigby only has a handful of tattoos – the only ones visible on his body being a small quill on the underside of his left arm, the black feather intricately done with no details left behind, the end of the feather almost burnt looking and blue ink drips from the nib, beside the quill is a tally of seven, a black cog on the back of his right hand, almost permanently covered by gloves for obvious reasons and finally the words “Lost” and “Lamb” are spelt across his knuckles in Old English font\nBigby has high cheekbones and an alright jawline, although it is nothing special – his face is dotted with freckles and is lightly tanned from a life spent outdoors in the Stormwind weather. \n\nIn the clothes department Bigby has one outfit that is constantly worn - a well maintained blue jumper, made from reasonably cheap wool and finished with brown stitching. There are a number of holes in the jumper that have had small patches of navy linen stitched over them. \nA pair of trousers with handy pockets stitched on beneath the actual pockets, a small button fastening them shut. \nA pair of leather boots are often worn, the hide that was once stained black has started to crack and lighten in colour, now resembling a light grey. This is owed to prolonged wear and tear.\nA black leather belt is wrapped around Bigby's waist, nothing particularly special about it, however the buckle seems to have a small compartment on the inside, who knows what treasure it holds?\n\nArt:\n{link*http://imgur.com/nn9Nldd*http://imgur.com/nn9Nldd}",
				},
