		["0223193712LJ1dq"] = {
			["character"] = {
				["CO"] = "*Info and personalised artwork in \"About\".\n*Non-recruitable.\n*Friendly and approachable.\n*Currently typing with one hand, so have patience.",
				["RP"] = 1,
				["CU"] = "Pondering and searching.\n\nMood: Friendly.",
				["XP"] = 1,
				["v"] = 69,
			},
			["time"] = 1496179018,
			["link"] = {
				["Zachariane-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 66,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}Background{/h1}\nBastian doesnt remember much from his life, be it places or people; he woke up in the medical center of Stormwind being very confused; his head bandaged and scarred and he had a swirling headache. Slowly he is starting to discover bits about his past, but is still far away to remember who he is and what has happened to him in order to solve the puzzle; however, he is certain about his name and age. He spends alot of his time in the Stormwind Keep trying to search for details about his life, and maybe even his family.\n\n{h1}Personality{/h1}\nBastian is a gentle, caring and polite guy, albeit cautious, protective and faithful. He has the soul of a poet and is a bit of a dreamer and romantic, old-fashioned would be a better word. The fact that he is challenged in terms of his past and memory has left him shy. He often spends his time writing in his journal in the park or perusing the files in the library in Stormwind Keep.\n\n{h1}Looks{/h1}\nBastian is tall, above average in height and has the physique of a soldier; heavy set but not extremely muscular; athletic, toned.\nHis long brown hair is often up in a ponytail, with parts of his hair hanging down on his shoulders. Bastian has pale blue eyes with a tint of grey; they have a gentle but playful look to them. His face is weathered, a few scars here and there scattered under the stubble, stubble is long enough to be soft to touch, across high cheekbones and a sharp jawline.\n\n{h1}Misc. Info{/h1}\nCustomised/personalised artwork: {link*http://imgur.com/a/4Knr3*Bastian Gregory - \"Before The Battle\"} \nLink to artist: {link*http://belvane.deviantart.com/gallery/*Belvane on Deviant Art}\nVoice: Russell Crowe, but deeper.\nI ignore lollers, trolls, morons, rudes and godemoters.",
				},
			},
