				["IC"] = "INV_Jewelcrafting_PurpleOwl",
				["AG"] = "Adult",
				["CL"] = "Male",
				["FN"] = "Inu'Aren",
				["MI"] = {
					{
						["IC"] = "Item_HerbC",
						["NA"] = "Nickname",
						["VA"] = "Inu, Aren",
					}, -- [1]
					{
						["IC"] = "spell_shadow_mindsteal",
						["NA"] = "Physiognomy",
						["VA"] = "Unblemished",
