				},
				["BP"] = "Ashenvale",
				["v"] = 5,
				["FT"] = "Flower Boy",
				["HE"] = "214cm",
				["CH"] = "a589e3",
			},
			["about"] = {
				["v"] = 16,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:ad89ff}<Overall Appearance>{/col}{/h2}\n{col:ffffff}A Kaldorei standing just above average in the height of his kin, with a slender-looking frame due to his well-fitted outfits. Though a free-spirit at heart and often wearing lighter clothes, he doesn't wear anything revealing, and is rarely seen topless, or even in short sleeves.\n\nWaist-long hair falls down over his back, occasionally letting some of it fall in front of his face. He carries it like a royal mane. Though thick-looking, it's light enough to flow with the winds, and on touch, it's almost soft enough to be considered eerie.\n\nHis face is scar-free, almost a bit bland. Basically looking like any other elf, was it not for his fangs being somewhat larger, and sharper than average. Silvery eyes softly illuminate his gaze, just in front of him, though the glow wouldn't be visible as he shuts his eyes.{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h2:c}{col:ad89ff}<Overall Behaviour>{/col}{/h2}\n{col:ffffff}Though appearing young, and curious, Inu'Aren has the mind of a brother. Not a 'Brother', but an actual blood-related one. Protective in nature and cautious in his way of acting around some people. Especially if he sees someone stuck in bad circumstances, almost as if it's something he can relate to.\n\nAside from that, he seems to be quite the extrovert. Loving to interact with people and never one to shy away from physical contact, he appears happy-go-lucky and flirty most of the time. One shouldn't always take it too seriously.{/col}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-WispAmulet:512:256}\n\n{p:c}{col:ad89ff}What's rarely revealed about Inu'Aren are things trapped in his past. His chest is coated in burn-scars and stab-marks, his ankles bearing evidence of having been cuffed for several years. The occasional evidence of a different colour being seen in his hair, though rarely enough to become fully noticeable due to how often he dyes it. There's a lot to learn about this elf.{/col}{/p}\n\n",
				},
