						["TI"] = "Ranged Weaponry",
						["TX"] = "Pistols:\nAttached to her waist in pistol holders, would be two preloaded single-shot pistols. The pistols would be good quality and have the initials \"B.R\" engraved on them. They would be a set of \n-Volunteer, 15 Bore, light dragoon flintlock pistols-.\n\nRevolver:\nAttached to her right leg is a preloaded seven-shot revolver. Upon closer inspection the handiwork would be that of a Blackwater Raider, a rather finely crafted peice of wood, metal and leather that gleams black with paint, complimented by the light tones of oakwood.\n-Reminiscient of the Colt, Single Army Action-.\n\nMounted Crossbow:\nAttached to her left wrist is a mini-crossbow mechanism that fires one bolt, then requires reloading. It would be preloaded and a bolt pouch is on her belt.\n",
						["AC"] = true,
					},
					["3"] = {
						["IC"] = "INV_Legendary_Sword",
						["TI"] = "Cutlasses and Blowpipe",
						["TX"] = "Attached to her belt, sheathed in a thick, bear-leather, scabbard would be a cutlass, on her right and another one on her left. The two weapons would be sharpened fully and in a good condition, although seemingly have seen action.\n\nAttached on her back would be a blowpipe covered in black leather, it'd fire small, darts, with varied effects. (Sleep darts, Toxic darts and Hemotoxic (Blood toxic) darts). Dart pouch on belt.",
