			["time"] = 1496092748,
			["zone"] = "Stormwind City - Stormwind Harbor",
			["about"] = {
				["v"] = 51,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Lewis Connell{/h1}\n{h3}Face & Head{/h3}\nYouthful would likely be the best word to describe Lewis' face, lacking any scar besides the smallest of cuts along his left cheek, the lack of more facial hair than a mere stubble would also reinforce this young aura. His profile would also carry a heavy positiveness, consistent through combat and distress.\n\n{h3}Weapons{/h3}\nLewis seems to carry his own little arsenal of sorts, the weapons to his disposal however pretty conventional. Along his waist are two sheaths, their shape more similar to that of scimitars than conventional short swords. Laced around his left hand is a knuckle duster, unornamented and regular besides the engraving of the name 'Brian' on its side. Finally, Lewis' flintlock sits in a holster on his bandoiler, easy to draw yet loud and awful at long rangers, it attains a red wooden body, adorned with a golden metalic body, fancy indeed.\n\n{h3}Voice{/h3}\nLewis' accent can be rather simply defined as noticeably working class Gilnean.\n\n{h3}Personality{/h3}\nA hedonist at heart, Lewis pursues life with an optimistic enthusiasm especially when concerning the sea, despite his more rough adolescence, Lewis carries a lot of spirit. However, in spite of his usually cheerful character, this Gilnean isn't worried about getting dirty or ill-mannered, particularly towards snobbery.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}",
				},
			},
