					},
					["1"] = {
						["IC"] = "INV_Chest_Leather_27v2",
						["TI"] = "Apparel",
						["AC"] = true,
						["TX"] = "-Armor-\nLewis' armor is tight fitting, complimenting his agile nature. The quality itself is rather poor, small scratches, dents and stains being noticable. One important piece of equipment is his belt, dressed with small pouches and bandoilers which evidently allow him to store particular useful or pointless paraphernalia.\n-Casual-\nLight fitting and comfortable, Lewis' casual clothes are that of a civillian, his striped troursers are tucked into standard issue prisoner boots, whilst his rugged shirt is too tucked within his belt. A bandoiler is fit around his chest containing small pockets that'd be able to carry very little.",
					},
					["2"] = {
						["IC"] = "INV_Sword_94",
						["TI"] = "Weapons",
						["AC"] = true,
						["TX"] = "-Exotic Swords-\nThough not your conventional human forged blade, Lewis' weapons possess the usual compartments of a sword, the handles are embroided with dulled gems. The blades bolster a scimitar like edge yet still retain a pointed edge, allowing both stabbing and slashing movements.\n-Flintlock Pistol-\nBeing a man without the capacity to conjure magic, Lewis must rely on more conventional means to fight. As such he has adopted the use of a flintlock pistol and two swords.\n-Knuckle duster-\nPretty self explanatory, held in his left hand. It has a purely metalic body. This would not be on when wearing casual clothing.",
