			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n{icon:INV_Misc_Herb_Goldclover_Leaf:25} {col:ff30ce}Appearance{/col}\nFiery and long red hair almost fully covers a full, cheerful face. Heavy green eyes, set charmingly within their sockets, watch rapidly over her surroundings with delight,studying the bypassers.\n\nSmooth and slightly pale skin,gracefully compliments her full lips and face. Her form is curvaceuous yet slim. This is a trait that goes rapidly to the eyes of whoever would be looking at her.\n\nThis is \"Marcail Westmill\", a mysterious,charming woman. \n\nThere's something incomprehensible about her, perhaps it's the fact that she changes appearance every now and then,or the fact that she doesn't like to remember her past. \n\n{icon:INV_Misc_Book_16:25} {col:ff30ce}Past{/col}\nDaughter of wealthy mages, she ran away from her home. She soon became an outlaw, taking advantage of her appearance to get whatever she'd like. Soon, Marcail regretted her choice,when a man brought her in jail. With the right contacts and friends, she got out within days,mostly helped by the fact that the bounty she had on her head was low, due to her changing always her aspect.\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256} \n\n{col:79a9ff}Knowledge{/col}\n- Arcane\n- Illusions\n- Fire magic (an inheritance from her family,she doesn't like to use it)\n- Slightly knowledge of portals\n- Slightly knowledge of summoning (Low level,can summons little things like books...or her make up.)",
