				["v"] = 21,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}Tilliana Shadowblade{/h1}\n{h3:c}Sorry, sorry!{/h3}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{col:9030ff}Tilliana is a rather cute young night elf. Her long dark blue hair reaches down to her waist and it looks as if it's being well taken care of, she also has a straight fringe just above her eyebrows. The deep color of her hair matches her deer-like silver colored eyes, gleaming with curiosity.\n\nTilliana appears to have slightly chubby cheeks, and because of that you can see her blush very well, and she blushes quite a lot. The warm look on her face makes her look reliable. If she lies, it would be easy to notice, she is a terrible liar.\n\nThere are no visible scars on her face, but if she isn't covering her shoulders, you can see a small scar from a sword on her right shoulder.{/col}\n\n",
				},
